8538b19af5ba7b6cb6f0169979a9ff45:
query RootQuery {
  authentication {
    user {
      username
    }
    cookie {
      redeemed
      registered
      sameSession
    }
  }
}

681b8d7958c1231ee10b34b7b921278f:
subscription LobbySubscription {
  authListener {
    sameSession
    cookie {
      registered
    }
  }
}

cfa55e171caaf100d02a5c3f65c631b0:
query TokenQuery(
  $cookie: String!
) {
  redeemCookie(cookie: $cookie) {
    sameSession
    registered
    session
  }
}
